<script>
import LoginForm from './components/LoginForm.vue'
import FullPage from './components/FullPage.vue'
import Store from './components/Store.vue'
import Dialog from './components/windows/Dialog.vue'

export default {
  name: 'App',
  components: {
    LoginForm,
    FullPage,
    Store,
    Dialog
  },
  sockets: {
    debug: function ({ msg }) {
      console.log("Debug from server: ", msg);
    },
    permissionSetError({ reason }) {
      console.log("Error: " + reason);
    },
    fullServerSend(data) {

      if(!this.$store.state.servers[this.$store.state.selectedServer].local) {
          this.$store.state.servers[this.$store.state.selectedServer].local = {};
      }
      const servers = this.$store.state.servers;
      let index;
      const _tmp = servers.find((val, i) => { index = i; return val.id === data.id });
      if(!_tmp) {
        // We were sent a server info for a server we don't have
        index = servers.length;
        servers.push({});
        servers[index].local = {};
      }
// server = data;
      const local = this.$store.state.servers[index].local;
      this.$store.state.servers[index] = data;
      this.$store.state.servers[index].local = local;
      this.$store.state.tabReset++;
      // setTimeout(() => {
      //   this.$store.state.tabReset = !this.$store.state.tabReset;
      // }, 1000);
    },
    serverUpdate({ consoleAppend, properties, id, status, worlds, currentWorld, allowedUsers, output, permissions, plugins, scriptingTabs }) {
      const server = this.$store.state.servers.find(s => s.id === id);
      // console.log("DATA SERVER UPDATE: " + consoleAppend + " " + properties);
      if(consoleAppend) {
        server.output += consoleAppend;
      }
      if(properties) {
        server.properties = properties;
      }
      if(status) {
        server.status = status;
        if(status == 'Starting') server.output = '';
      }
      if(worlds) {
        server.worlds = worlds;
      }
      if(currentWorld) {
        server.currentWorld = currentWorld;
      }
      if(allowedUsers) {
        server.allowedUsers = allowedUsers;
      }
      if(typeof output == 'string') {
        server.output = output;
      }
      if(permissions) {
        server.permissions = permissions;
      }
      if(plugins) {
        server.plugins = plugins;
      }
      if(scriptingTabs) {
        server.scriptingTabs = scriptingTabs;
      }
      this.$store.state.tabReset++;
    },
    clobberAll({server}) {
      let serverobj = this.$store.state.servers.find(s => s.id === server.id);
      if(!serverobj) {
        serverobj = {};
        this.$store.state.servers.push(serverobj);
        serverobj.properties = {};
        serverobj.local = {};
        serverobj.id = server.id;
      }
      serverobj.version = server.version;
      serverobj.onlinePlayers = server.onlinePlayers;
      serverobj.access = server.access;
      serverobj.status = server.status;
      serverobj.controls19132 = server.controls19132;
      serverobj.description = server.description;
      serverobj.currentWorld = server.currentWorld;
      serverobj.properties['max-players'] = server['max-players'];
      serverobj.properties['server-port'] = server['server-port'];
      serverobj.properties['server-name'] = server['server-name'];
      // console.log("clobberall " + JSON.stringify(serverobj));
      this.$store.state.tabReset++;
    },
    logout() {
      window.location.reload(false);
    },
    localPermUpdate({ serverId, /*newPermissions*/ }) {
      // Line is redundant since it will be overwriten by load anyways
      // this.$store.state.servers.find(s => s.id === serverId ).access = newPermissions;
      this.$socket.client.emit("serverLoad", { serverId });
    },
    globalPermUpdate({ newPermissions }) {
      // Record new permissions
      this.$store.state.currentUserData.globalPermissions = newPermissions;
      // Reload current server in case our new permissions includes CAN_OVERRIDE_LOCAL
      this.$socket.client.emit("serverLoad", { serverId: this.$store.state.servers[this.$store.state.selectedServer].id });
    },
    infoWindow({ msg }) {
      this.errorText = msg;
      this.error = true;
    },
    serverDeleted({ serverId }) {
      const index = (this.$store.state.servers).findIndex(server => serverId === server.id);
      this.$store.state.servers.splice(index, 1);
      if(index === this.$store.state.selectedServer) this.$store.state.selectedServer = -1;
      this.$store.state.tabReset++;
    }
  },
  data() {
    return {
      error: false,
      errorText: ''
    }
  }
}

</script>

